public class Solution {
    public int MinimumChanges(string s, int k) {
        int n = s.Length;
        int[,] dp = new int[k + 1, n + 1];
        for (int i = 0; i <= k; i++)
            for (int j = 0; j <= n; j++)
                dp[i, j] = int.MaxValue / 2;
        dp[0, 0] = 0;

        for (int i = 1; i <= k; i++)
            for (int j = 1; j <= n; j++)
                for (int l = 1; l <= j; l++) {
                    int cost = 0;
                    int[] count = new int[26];
                    int maxFreq = 0;
                    for (int m = j - l; m < j; m++) {
                        maxFreq = Math.Max(maxFreq, ++count[s[m] - 'a']);
                    }
                    cost = l - maxFreq;
                    dp[i, j] = Math.Min(dp[i, j], dp[i - 1, j - l] + cost);
                }

        return dp[k, n];
    }
}
